def migratoryBirds(arr)
  birds_hash = Hash.new
  arr.each do |n|
    if !birds_hash[n]
      birds_hash[n] = 1
    else
      birds_hash[n] += 1
    end
  end
  birds_hash.select{|k, v| v == birds_hash.max{|x, y| x[1] <=> y[1]}[1]}.min[0]
end

p migratoryBirds(arr)

